import "../css/App.css";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Test from "./Test";
import Result from "./Result";
import Info from "./Info";
import Header from "./Header";
import Menu from "./Menu";

function App() {
  return (
    <div className="app">
      <Router basename="/scrapthe9to5.com/admin/personality/build">
        {/* <Header /> */}
        <Switch>
          <Route path="/test">
            <Test />
          </Route>
          <Route path="/result">
            <Result />
          </Route>
          <Route path="/info">
            <Info />
          </Route>
          <Route path="/">
            <Menu />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
